import './App.css';
import TrelloList from './components/TrelloList';
import { makeStyles } from '@mui/styles';

const useStyle = makeStyles(theme => ({
  roots: {
    display:"flex",
    minHeight:"100vh",
    overflowY:"auto"
  } 

}));

function App() {
  const classes = useStyle();
  return (
    <div className={classes.roots}>
      <TrelloList/>
      <TrelloList/>
    </div>
  );
}

export default App;
